import React from "react";
import styled from "styled-components";

export default function DonationDetailsContainer() {
  return (
    <div>
      <MainContainer>
        <MainBranchMediacan>
          <p>Thanking To Medicana Donor</p>
        </MainBranchMediacan>
        <DetailsOfMainBranch>
          <Information>
            <p>
              Lorem ipsum dolor, sit amet consectetur adipisicing elit. Pariatur
              laudantium fuga deleniti veritatis qui culpa molestias minus, ea
              illo reprehenderit magni sit assumenda corrupti quasi est ex fugit
              aliquid, ipsa nemo fugiat necessitatibus obcaecati. Lorem ipsum
              dolor sit amet consectetur adipisicing elit. Alias harum, omnis
              quo in, ullam facilis autem totam dolorum reiciendis ratione natus
              veniam cum similique suscipit cupiditate. Consequuntur consequatur
              distinctio non sit architecto repellendus impedit!
            </p>
          </Information>
        </DetailsOfMainBranch>
      </MainContainer>
    </div>
  );
}

const MainContainer = styled.div`
  width: 90%;
  position: relative;
  left: 95px;
  top: 40px;
  text-align: center;
`;

const MainBranchMediacan = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  margin: 3%;

  p {
    text-align: center;
    font-family: "Bree Serif", serif;
    font-size: 2rem;
    color: white;
    font-weight: bold;
    display: inline-flex;
    padding: 10px;
    box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
    background-color: rgb(255, 255, 255);
    color: #090b13;
    border-radius: 5px;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
  }
`;

const DetailsOfMainBranch = styled.div`
  box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
  border-radius: 5px;
  background-color: white;
`;

const Information = styled.div`
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;
  align-items: center;
  justify-content: center;
  margin: 3%;
  p {
    text-align: center;
    color: #090b13;
    font-family: "Roboto", sans-serif;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
    box-sizing: border-box;
    margin-top: 10px;
  }
`;
